import React from "react";
import Motor3d from "../generalLayout/motor3d";
import PageName from "../generalLayout/pageName";
import MotorPageHeader from "../generalLayout/motorPageHeader";
import MotorSlideImg from "../generalLayout/motorSlideImg";
import MvEmail from "../generalLayout/mvEmail";
import { ScrollNavFunction } from "../generalFunctionForOnScroll/ScrollEventFor_MotorPage";
import { FooterGe } from "../generalLayout/footer_test";
import Nav from "../generalLayout/nav";
import { NavWhiteCompact } from "../generalFunctionForOnScroll/ScrollEventFor_Homepage";
import NavDesktop from "../generalLayout/navDesk";
import DesignTips from "../generalLayout/designTips";

const dragster800rrscs_infor = {
  namePage: "Dragster 800 RR SCS",
  price: "19.490",
  nameHeaderTitle: "dragster800rrscs/dragster-800-rr-scs.svg",
  bgHeaderParallax: "dragster800rosso/dragster-800-rosso-xl.png",
  manifesto_Arr: ["THE", "SMART", "STREET", "FIGHTER"],
  colorBg: "#c29b2f",
  contentHeaderContent:
    "Dragster exudes exuberance and character. Born to inspire and ready to burn the tarmac, effortlessly and carefree thanks to its smart shifting system.",
};
export default function BodyDragster800RRSCS() {
  window.addEventListener("scroll", () => {
    ScrollNavFunction();
    NavWhiteCompact();
  });
  return (
    <>
      <div
        className="nav-pc-homepage"
        style={{
          height: "84px",
          width: "100vw",
          background: "rgb(194, 155, 47)",
        }}
      ></div>
      <NavDesktop />
      <Nav color="white"/>
      <PageName namePage={namePage}></PageName>
      <MotorPageHeader
        manifesto_Arr={manifesto_Arr}
        nameHeaderTitle={nameHeaderTitle}
        titleSize="auto 25%"
        colorBg={colorBg}
        contentHeaderContent={contentHeaderContent}
        price={price}
        bgHeaderParallax="dragster800rrscs/dragster-800-rr-xl.png"
        reveredContent={false}
        heightContentTop="11.5%"
      />
      <Motor3d
        imgLocate="dragster800rrscs/dragster800rr"
        nameModel="MV AGUSTA DRAGSTER 800 RR SCS"
        price={price}
      />
      <DesignTips />
      <MvEmail />
      <br />
      <FooterGe />
    </>
  );
}
